import manageJss from "@microsoft/fast-jss-manager-react";
import { ActionToggleStyles } from "@microsoft/fast-components-styles-msft";
import MSFTActionToggle, { ActionToggleAppearance, } from "./action-toggle";
import actionToggleSchema from "./action-toggle.schema";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const ActionToggle = manageJss(ActionToggleStyles)(MSFTActionToggle);
export { ActionToggle, ActionToggleAppearance, actionToggleSchema, };
